import Note from "./Note";
import Header from "./Header";

const Course = ({ notes }) => {
  return (
    <div>
      <Header>Notes</Header>
      <ul>
        {notes.map((note) => (
          <Note key={note.id} note={note} />
        ))}
      </ul>
    </div>
  );
};

export default Course;
